import axios from 'axios';
const url = "http://localhost/api/quests";

const ContextHome = createContext();

import { useNavigate} from "react-router-dom";

import React, { createContext, useState, useEffect } from 'react';

import { Context } from './AuthContext';

const urlRecomendedQuests = "http://localhost/api/quests/recomended";

const urlAllQuests = "http://localhost/api/quests";

const urlUser = "http://localhost/api/user/auth";

function HomeProvider({ children }){

	const { authenticated } = useContext(Context);

	const [recomendacoes, setRecomendados] = useState();

	const [loading, setLoading] = useState();

    const [questionarios, setQuests] = useState();

	const [user , setUser] = useState(null);

  	const navigate = useNavigate();

  	useEffect((e) => {

  		getQuests(e);

  		if (authenticated) {
  			getRecomended();
  			getUser();
  		}

        setLoading(false);

    }, []);

	async function getQuests(e){

		e.preventDefault();

		const token = localStorage.getItem('token');
	        const teste = async () => {
	            const response = await axios.get(urlAllQuests, {
	            }).then(function (response) {

	            	if(response.data){
	                	setQuests(response.data);
	            	}

	            }).catch(function (error) {

	              console.log(error);

	            });
	        }
         teste();
	}

	async function getRecomended(){

		e.preventDefault();

        const teste = async () => {
            const response = await axios.get(urlRecomendedQuests, {
            }).then(function (response) {
	            if(response.data){
	                setRecomendados(response.data.recomendacoes);
	            };
            }).catch(function (error) {

              console.log(error);

            });
        }
        teste();
	}

	async function getUser(){

		e.preventDefault();

		const token = localStorage.getItem('token');
        const teste = async () => {
            const response = await axios.get(urlUser, {
            }).then(function (response) {
	            if(response.data){
	                setUser(response.data);
	            };
            }).catch(function (error) {

              console.log(error);

            });
        }
        teste();
	}

	useEffect((e) => {
        if(questionarios != undefined){
        	setLoading(false);
        }
    }, [questionarios, recomendados, user]);


	if (loading) {
		return <h1>loading.....</h1>;
	}

	return(
		<Context.Provider value={{ questionarios, recomendacoes , user}}>
			{children}
		</Context.Provider>
		);
}

export { ContextHome, HomeProvider };
